import React from 'react'
import search from '../assets/search.svg'
import pinterest from '../assets/pinterest.svg'
import view_thumbnail from '../assets/view_thumbnail.svg'
import view_uneven from '../assets/view_uneven.svg'
import view_detailed from '../assets/view_detailed.svg'
import { TextField, IconButton, InputAdornment } from '@mui/material'
import { withStyles } from '@mui/styles'

const StyledTextField = withStyles({

    root: {
        '& label.Mui-focused': {
            color: 'white',
        },
        '& .MuiInput-underline:after': {
            color: 'white',
            borderBottomColor: '#D7143A',
        },
        '& .MuiOutlinedInput-root': {
            '& fieldset': {
                borderColor: '#ffffff00',
                color: 'white',
                backgroundColor: '#ffffff10',
                borderRadius: '90px',
            },
            '&:hover fieldset': {
                color: 'white',
                borderColor: '#ffffff00',
            },
            '&.Mui-focused fieldset': {
                color: 'white',
                borderColor: '#D7143A',
            },
        },
    },
})(TextField);

export default function Header() {
    return (
        <div className='Header'>
            <img src={pinterest} alt="pinterest" id='appicon' />
            <TextField id="outlined-basic" label="Search" variant="outlined"
                sx={{
                    ".MuiOutlinedInput-root": {
                        borderRadius: '90px',
                        paddingTop: "1rem",
                        flexDirection: "column"
                    },
                }}
                InputProps={{
                    endAdornment: <img src={search} />
                }} />
        </div>
    )
}
